import React, { useState, useEffect } from 'react';

const exportToCSV = (data, filename = 'arbitrage_opportunities.csv') => {
  if (!data || data.length === 0) return;
  const headers = Object.keys(data[0]).join(',');
  const rows = data.map(obj => Object.values(obj).join(','));
  const csvContent = 'data:text/csv;charset=utf-8,' + [headers, ...rows].join('\n');
  const encodedUri = encodeURI(csvContent);
  const link = document.createElement('a');
  link.setAttribute('href', encodedUri);
  link.setAttribute('download', filename);
  document.body.appendChild(link);
  link.click();
  document.body.removeChild(link);
};

function Scanner() {
  const [opps, setOpps] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      setError(null);
      try {
        const response = await fetch(
          'http://localhost:5000/api/arbitrage?pairs=BTC-USDT,ETH-USDT,LTC-USDT,XRP-USDT,ADA-USDT,SOL-USDT,DOGE-USDT,MATIC-USDT,DOT-USDT,AVAX-USDT'
        );
        if (!response.ok) throw new Error(`HTTP error! ${response.status}`);
        const data = await response.json();
        setOpps(data);
      } catch (err) {
        console.error("Fetch error:", err);
        setError("Failed to fetch arbitrage data.");
        setOpps([]);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
    const intervalId = setInterval(fetchData, 30000);
    return () => clearInterval(intervalId);
  }, []);

  return (
    <div className="p-6 bg-gray-700 rounded-md shadow-inner">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-2xl font-bold text-blue-300">Opportunities over 5%</h2>
        <button
          onClick={() => exportToCSV(opps)}
          className="bg-blue-600 hover:bg-blue-700 text-white px-6 py-2 rounded-lg"
        >
          Export CSV
        </button>
      </div>
      {loading && <p className="text-blue-300">Loading...</p>}
      {error && <p className="text-red-500">{error}</p>}
      {!loading && !error && opps.length === 0 && (
        <p className="text-gray-400">No arbitrage opportunities found.</p>
      )}
      {!loading && !error && opps.length > 0 && (
        <table className="w-full text-sm text-left text-gray-300">
          <thead className="text-xs uppercase bg-gray-600 text-gray-300">
            <tr>
              <th className="px-4 py-2">Pair</th>
              <th className="px-4 py-2">Buy From</th>
              <th className="px-4 py-2">Buy Price</th>
              <th className="px-4 py-2">Sell To</th>
              <th className="px-4 py-2">Sell Price</th>
              <th className="px-4 py-2">Profit %</th>
            </tr>
          </thead>
          <tbody>
            {opps.map((op, i) => (
              <tr key={i} className="bg-gray-800 hover:bg-gray-700">
                <td className="px-4 py-2">{op.pair}</td>
                <td className="px-4 py-2">{op.buyExchange}</td>
                <td className="px-4 py-2 text-green-400">${parseFloat(op.buyPrice).toFixed(2)}</td>
                <td className="px-4 py-2">{op.sellExchange}</td>
                <td className="px-4 py-2 text-red-400">${parseFloat(op.sellPrice).toFixed(2)}</td>
                <td className="px-4 py-2 text-purple-400">{op.profitPercentage}%</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default Scanner;
